import React from "react";

import { MyUsers } from "../data/users";
import { UserProps } from "../data/interfaces";


export default function MapDatas(props:UserProps) {
return (
    <li className="imageBlock" key={`el-${props.key}`}>
        <p>{props.name}</p>
        <p>{props.last_name}</p>
        <p>{props.city}</p>
        <p>{props.country}</p>
        <p>{props.books}</p>
    </li>
)   
}
